import {useParams} from "react-router-dom";
import {useEffect} from "react";
import axios from "../config/axios";

const Publication = () => {
    const {id} = useParams();

    useEffect(() => {


        const getPublication = () => {
            return axios
                .get('/publications' + parseInt(id))
                .then((response) => {
                    return response.data;
                })
                .catch((error) => {
                    return error;
                })
        }
    }, []);

    return (
        <div>
            {parseInt(id)}
        </div>
    )
}

export default Publication;
